        //èŽ·å–æ•°æ®
        function getdata(branch,datatype,times){
            var dataUrl="/getgkdata.php";
            var data=[];
            //èŽ·å–æ•°æ®
            $.ajax({
                url: dataUrl+"?branch="+branch+"&datatype="+datatype+"&times="+times,
                type: "GET",
                async:false,
                success: function(result){
                    // console.log(result);
                    data=result.split('\n');
                    //åŽ»é™¤é¦–å°¾æ— ç”¨æ•°æ®
                    data.shift();
                    data.pop();
                    
                }
            });
            return data;
        }

        //è¿‡æ»¤æŽ‰è¡Œä¸šå­¦é™¢
        function isfenbu(data){
            var data=data.filter(function(item){
                var temp="";
                for(var i=0;i<fenbu.length;i++){
                    if(item.indexOf(fenbu[i])> -1){
                        temp=item;
                    }
                }
                return item==temp;
            });
            return data;
        }

        //è¿‡æ»¤æŽ‰åˆ†éƒ¨
        function ishyxy(data){
            var data=data.filter(function(item){
                var temp="";
                for(var i=0;i<hyxy.length;i++){
                    if(item.indexOf(hyxy[i])> -1){
                        temp=item;
                    }
                }
                return item==temp;
            });
            return data;
        }

        //è½¬æ¢æ•°ç»„,èŽ·å–xè½´ï¼Œyè½´ æ•°æ®
        function gotoxy(data){
            var xAxis=[]; 
            var yAxis=[];
            var xydata=[];

            $.each(data,function(i,v){
                xAxis[i]=v.split(',')[1];
                yAxis[i]=v.split(',')[2];
            })

            xydata[0]=xAxis;
            xydata[1]=yAxis;

            return xydata;
        }

