        function getOption(xdata,ydata,title,subtitle){
            var option = {
                title: {
                    text: title,
                    subtext: subtitle,
                    top:30,
                    left:50,
                },
                grid:{
                    top:115,
                    left:95,
                    bottom:'20%'
                },
                tooltip: {},
                xAxis: {
                    data:xdata,
                    axisLabel: {
                        interval:0,
                        formatter:function(value)
                        {
                            return value.split("").join("\n");
                        }
                    }
                },
                yAxis: {},

                series: [{
                    type: 'bar',
                    barWidth:8,
                    barMaxWidth: 8,
                    itemStyle: {
                        normal: {
                            barBorderRadius:  [7, 7, 0, 0],
                            color: new echarts.graphic.LinearGradient(
                                0, 0, 0, 1,
                                [
                                    {offset: 0, color: '#0097FF'},
                                    {offset: 1, color: '#963DFF'}
                                ]
                            ),
                        }
                    },
                    data: ydata
                }]
            };

            return option;
        }

